const Home = () => {
    const handleClick = () => {
        console.log('Hellooo, whats on the go!')
    }

    const handleClickAgain = (name) => {
        console.log('Hello ' + name);
    }

    return (
        <div className="home">
           <h2>Homepage</h2> 
           <button onClick={handleClick}>Click me!</button>
           <button onClick={() => {
               handleClickAgain('Joel')
           }}>Click this one!</button>
        </div>
    );
}
 
export default Home;
